import React, { useState } from "react";
import "./App.css";

function App() {
  const [menuItems, setMenuItems] = useState([
    { id: 1, name: "Pizza Margherita", price: 10 },
    { id: 2, name: "Spaghetti Carbonara", price: 12 },
    { id: 3, name: "Tiramisu", price: 6 },
  ]);

  const [cart, setCart] = useState([]);

  const addToCart = (item) => {
    setCart([...cart, item]);
  };

  const removeFromCart = (id) => {
    setCart(cart.filter((item) => item.id !== id));
  };

  const addMenuItem = (newItem) => {
    setMenuItems([...menuItems, { id: Date.now(), ...newItem }]);
  };

  const removeMenuItem = (id) => {
    setMenuItems(menuItems.filter((item) => item.id !== id));
  };

  return (
    <div className="App">
      <header>
        <h1>PedidosYa Clone</h1>
        <p>Explora, selecciona y disfruta de tus comidas favoritas</p>
      </header>

      <main>
        <section className="menu-section">
          <h2>Men√∫</h2>
          <div className="menu-grid">
            {menuItems.map((item) => (
              <div key={item.id} className="menu-item">
                <h3>{item.name}</h3>
                <p>Precio: ${item.price}</p>
                <button onClick={() => addToCart(item)}>Agregar al carrito</button>
                <button onClick={() => removeMenuItem(item.id)}>Eliminar del men√∫</button>
              </div>
            ))}
          </div>
        </section>

        <section className="cart-section">
          <h2>Carrito de Compras</h2>
          {cart.length > 0 ? (
            cart.map((item) => (
              <div key={item.id} className="cart-item">
                <p>{item.name}</p>
                <p>${item.price}</p>
                <button onClick={() => removeFromCart(item.id)}>Eliminar</button>
              </div>
            ))
          ) : (
            <p>Tu carrito est√° vac√≠o</p>
          )}
          {cart.length > 0 && <h3>Total: ${cart.reduce((acc, item) => acc + item.price, 0)}</h3>}
          {cart.length > 0 && <button>Proceder al pago</button>}
        </section>

        <section className="admin-section">
          <h2>Agregar Nuevo Plato</h2>
          <form
            onSubmit={(e) => {
              e.preventDefault();
              const formData = new FormData(e.target);
              const newItem = {
                name: formData.get("name"),
                price: parseFloat(formData.get("price")),
              };
              addMenuItem(newItem);
              e.target.reset();
            }}
          >
            <input name="name" type="text" placeholder="Nombre del plato" required />
            <input name="price" type="number" placeholder="Precio" required />
            <button type="submit">Agregar al men√∫</button>
          </form>
        </section>
      </main>

      <footer>
        <p>&copy; 2024 PedidosYa Clone. Todos los derechos reservados.</p>
      </footer>
    </div>
  );
}

export default App;
